import Link from "next/link";

const Logo = () => (
  <>
    <Link href="/">
      <a className="logo">WooYoungChoi</a>
    </Link>
    <style jsx>
      {`
        .logo {
          text-decoration: none;
          float: left;
          font-family: "futura";
          font-size: 20px;
          font-weight: bold;
          color: #00ace6;
        }
      `}
    </style>
  </>
);

const Header = () => (
  <>
    <div className="navbar">
      <Logo />
      <div className="wrapper">
        <Link href="/">
          <a className="navlink">Home</a>
        </Link>
        <Link href="/about">
          <a className="navlink">About</a>
        </Link>
      </div>
    </div>
    <style jsx>
      {`
        .navbar {
          display: inline-block;
          width: 100%;
          border: solid;
        }

        .navlink {
          display: inline-block;
          font-family: "Arial";
          margin: 15px;
          text-decoration: none;
        }

        .navlink:hover {
          opacity: 0.6;
        }
      `}
    </style>
  </>
);

export default Header;
